import React, { Component } from "react";

export default class Talent extends Component {
  state = {
    selected: false
  };

  render() {
    return (
      <div>
        <tr>
          <td>
            <img src={this.props.talent.icon_url["64x64"]} />
          </td>
        </tr>
      </div>
    );
  }
}
